- input: "TEXT\x1CC00167213\x1C.TEXT\x1C\x1CF3XA\x1COn March 4, 2011 the Oklahoma
    Leadership Council received notice that funds from the Levin account had been
    utlized beyond the customary 79/21 split to pay expenses occurred.  To correct
    this matter, funds were transferred from the Federal Account to the Levin account
    as follows:   Friday, April 22, 2011 at 8:29 AM in the amount of $5,880.00 and
    on Friday, April 22, 2011 at 8:31 AM in the amount of $4,452.00.  These transactions
    will be reflected on the report to be filed May 20, 2011.  \n"
